from collections import defaultdict

def solution(lines):
    lines = lines.splitlines()
    sequence = lines[0]
    k = int(lines[1])
    edgeList = [edge.split(" ") for edge in lines[2:]]
    internalNodes = defaultdict(list)
    for edge in edgeList:
        internalNodes[edge[0]].append(edge[1:])
    # print(internalNodes)
    deepestValid = (0, None)
    # depth, suffix
    print(k)


    internalNodesLeafCount = defaultdict(int)
    def countLeaves(node):
        nonlocal internalNodesLeafCount
        if node not in internalNodes:
            return 1
        children = internalNodes[node]
        total = 0
        for child in children:
            total += countLeaves(child[0])
        internalNodesLeafCount[node] = total
        return total
    countLeaves("node1")
    # print(internalNodesLeafCount)



    # suffix stores the cumulative prefix as an array of the (position, length) pairs
    def dfs(node, depth, suffix):
        # print(node)
        nonlocal deepestValid
        children = internalNodes[node]
        if depth > deepestValid[0] and internalNodesLeafCount[node] >= k:
            deepestValid = (depth, suffix)
        for child in children:
            if child[0] in internalNodes:
                dfs(child[0], depth + 1, suffix + [(child[1], child[2])])
    dfs("node1", 0, [])
    print(deepestValid)
    suffixIndices = deepestValid[1]
    result = ""
    for indices in suffixIndices:
        result += sequence[int(indices[0]) - 1: int(indices[0]) - 1 + int(indices[1])]
    print(result)
        

